import React from 'react';


function Sedgwick() {
    return (
        <div>
            <h1>Your style icon match is Edie Sedgwick! </h1>
            <img className='resultImg' alt="" src="https://pleasurephoto.files.wordpress.com/2017/12/edie-sedgwick-nov-1965-c2a9-frederick-eberstadt.jpg" />
            <h3 className='resultDescr'>You gravitate toward finding pieces that let you stand out, be it from the next fashion trend or a funky thrift store.</h3>
        </div>
    );
};



export default Sedgwick;
